import React from 'react'

const NoteItem = (props) => {
    const {note} = props;
  return (
    <div>
      
      
          <div class="card">
              <div class="card-header">
                  {note.title}
              </div>
              <ul class="list-group list-group-flush">
                  <li class="list-group-item">{note.description}</li>
              </ul>
          </div>
    </div>
  )
}

export default NoteItem
